import React from 'react'


export default function FormButton({ Title, Color}) {

  const buttonContainer = {
    width: 100, 
    height: 300,
    alignItems: 'center',
    justifyContent: 'center',
    backgroundColor: Color == undefined ? '#a93634' : Color,
    borderRadius: 10
  }

  return (
    <div style={buttonContainer}>
      {Title}
    </div>
  )
}
